import { Pipe, PipeTransform } from '@angular/core';
import { AccountStatus } from '../model/overview-enum.model';

@Pipe({ name: 'accountStatusPipe' })
export class AccountStatusPipe implements PipeTransform {
  accountStatusEnum: { [key: string]: AccountStatus } = AccountStatus;

  transform(status: string, logicalDel: number): string {
    if (logicalDel === 1) {
      return "Deleted"
    }
    else{
      return this.accountStatusEnum[status]
    }
  }
}
